import 'bootstrap/dist/css/bootstrap.min.css';
import logoGeo from '../assets/img/logo/geo-logo.svg'
function HeaderFDI() {
  return (
    <div>
    <div class="height: 100px;  d-flex flex-row justify-content-around mt-2 bg" style="background: ##F5F6FF">
    <div class="col-1">
    <img src={logoGeo } class="img-fluid img-thumbnai" alt="..." />
    </div>
    <div class="col-2">
    პირდაპირი უცხოური ინვესტიციების პორტალი
    </div>
    <div class="col-1">
      3 of 3
    </div>
  </div>
    </div>
  );
}
export default HeaderFDI;
